-- ----------------------------
-- Table structure for nodes
-- ----------------------------
DROP TABLE IF EXISTS `nodes`;
CREATE TABLE `nodes` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL COMMENT '创建者id',
  `category_id` int(11) unsigned DEFAULT NULL COMMENT '目录id',
  `title` varchar(500) NOT NULL COMMENT '标题',
  `sub_title` varchar(500) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT '',
  `body` text,
  `bodyHtml` text COMMENT '内容',
  `revise` tinyint(4) DEFAULT '0' COMMENT '修正',
  `weight` tinyint(4) DEFAULT '0' COMMENT '权重',
  `comment` tinyint(4) DEFAULT '0' COMMENT '评论',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态：0无,1首页显示,2推荐',
  `user_ip` varchar(50) DEFAULT NULL COMMENT '127.0.0.1',
  `user_agent` varchar(200) DEFAULT NULL,
  `view_total` int(11) DEFAULT '0',
  `view_day` int(11) DEFAULT '0',
  `view_week` int(11) DEFAULT '0',
  `summary` varchar(500) DEFAULT NULL COMMENT '概述',
  `thumbnail` varchar(225) DEFAULT NULL COMMENT '图片url',
  `tags` tinytext COMMENT '标签',
  `url` varchar(255) DEFAULT NULL COMMENT '链接地址',
  `is_delete` bit(1) DEFAULT b'0',
  `published_at` int(11) DEFAULT NULL COMMENT '发布时间',
  `expired_at` int(11) DEFAULT NULL COMMENT '过期时间',
  `created_at` int(11) NOT NULL COMMENT '创建时间',
  `updated_at` int(11) DEFAULT NULL COMMENT '更改时间',
  `hot_search` bit(1) DEFAULT NULL COMMENT '热点搜索',
  `stick` bit(1) DEFAULT NULL COMMENT '置顶显示',
  `is_recommend` bit(1) DEFAULT NULL COMMENT '是否推荐',
  `isHomeThumb` bit(1) DEFAULT b'0' COMMENT '是否有首图(首页显示关键)',
  PRIMARY KEY (`id`),
  KEY `category_id` (`category_id`),
  KEY `status_id` (`status`),
  KEY `user_id` (`user_id`),
  KEY `created_at` (`created_at`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

