-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_no` varchar(255) DEFAULT '' COMMENT '本系统生成的订单号',
  `order_name` varchar(255) DEFAULT '' COMMENT '订单名称',
  `order_body` varchar(500) DEFAULT '' COMMENT '订单描述',
  `order_url` varchar(300) DEFAULT '' COMMENT '订单链接地址',
  `payment_type` enum('none','alipay','tenpay','bank','paypal','card','offline','wxpay') DEFAULT 'none' COMMENT '支付方式',
  `original_money` decimal(12,3) DEFAULT '0.000',
  `money` decimal(12,3) DEFAULT '0.000' COMMENT '订单总金额',
  `invoice_title` varchar(255) DEFAULT '' COMMENT '发票抬头',
  `user_id` int(11) DEFAULT '0' COMMENT '消费用户ID',
  `from_id` int(11) DEFAULT '0' COMMENT '卖家',
  `emp_id` int(11) DEFAULT '0' COMMENT '销售员',
  `order_type` enum('NONE','SELL','PURCHASE','DELIVER','STORAGE','BARTER','RETURNED','RECHARGE','TAKEAWAY','BOOK') DEFAULT 'NONE' COMMENT '订单类别',
  `order_status` enum('NONE','WAIT_PAYMENT','PAYMENT_SUCCESS','PAYMENT_ERROR','SELLER_CANCEL','USER_CANCEL','WAIT_SURE','SHIPPED','RECEIVED','SURE','SYSTEM_STOP','FINISH','CHECKED') DEFAULT 'NONE' COMMENT '订单状态',
  `feedback_status` enum('NONE','PROCESSING','OVER','WAIT_AGREE') NOT NULL DEFAULT 'NONE' COMMENT '退货状态',
  `transport_fee` decimal(10,3) DEFAULT '0.000' COMMENT '运费',
  `remark` text COMMENT '备注',
  `arrived_at` int(11) DEFAULT '0' COMMENT '送达时间，预约时间等',
  `express_at` int(11) NOT NULL DEFAULT '0' COMMENT '发货时间',
  `sign_at` int(11) NOT NULL DEFAULT '0' COMMENT '签收时间',
  `close_at` int(11) NOT NULL DEFAULT '0' COMMENT '关闭时间',
  `refund_at` int(11) NOT NULL DEFAULT '0' COMMENT '退货时间',
  `is_delete` int(11) DEFAULT '0' COMMENT '是否删除',
  `created_at` int(11) DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(11) DEFAULT '0' COMMENT '更新时间',
  `pay_at` int(11) NOT NULL DEFAULT '0' COMMENT '支付时间',
  `feedback_at` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of orders
-- ----------------------------

