  `spec_id` int(11) DEFAULT '0',
  `price` decimal(10,3) DEFAULT '0.000' COMMENT '单价',
  `num` int(11) DEFAULT '0' COMMENT '数量',
  `size` varchar(255) DEFAULT '' COMMENT '尺码',
  `color` varchar(255) DEFAULT '' COMMENT '颜色',
  `set_meal` varchar(255) DEFAULT '' COMMENT '套餐',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
