-- ----------------------------
-- Table structure for orders_rates
-- ----------------------------
DROP TABLE IF EXISTS `orders_rates`;
CREATE TABLE `orders_rates` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT NULL COMMENT '订单ID',
  `goods_id` int(11) DEFAULT NULL COMMENT '商品ID',
  `goods_body` varchar(500) DEFAULT NULL COMMENT '商品评价内容',
  `service_body` varchar(500) DEFAULT NULL COMMENT '服务评价内容',
  `describe_score` int(11) DEFAULT NULL COMMENT '描述相符评价',
  `service_score` int(11) DEFAULT NULL COMMENT '服务态度评分',
  `deliver_score` int(11) DEFAULT NULL COMMENT '发货速度评分',
  `logistics_score` int(11) DEFAULT NULL COMMENT '物流速度评分',
  `courier_score` enum('-2','-1','0','1','2') DEFAULT NULL COMMENT '-2.失望 -1.不满 0.一般 1.满意 2.惊喜',
  `created_at` int(11) DEFAULT NULL,
  `updated_at` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of orders_rates
-- ----------------------------

-- ----------------------------
-- Table structure for orders_trades
-- ----------------------------
DROP TABLE IF EXISTS `orders_trades`;
CREATE TABLE `orders_trades` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NOT NULL DEFAULT '0',
  `return_status` enum('NONE','SUCCESS','ERROR') DEFAULT NULL COMMENT 'NONE：未处理 SUCCESS：支付成功 EERROR：支付失败',
  `real_money` decimal(10,3) DEFAULT NULL,
  `response_msg` text COMMENT '支付宝财付通等平台返回的信息',
  `return_trade_no` varchar(255) DEFAULT NULL COMMENT '支付宝、财付通等平台的订单编号',
  `out_trade_no` varchar(255) DEFAULT NULL COMMENT '商家订单编号',
  `request_msg` text COMMENT '通知客户，客户服务器返回的信息',
  `callback_url` varchar(300) DEFAULT NULL COMMENT '商户同步通知地址',
  `notify_url` varchar(300) DEFAULT NULL COMMENT '商户异步通知地址',
  `notify_params` varchar(500) DEFAULT NULL,
  `notify_status` enum('NONE','SUCCESS','ERROR') DEFAULT NULL COMMENT 'NONE：未通知 SUCCESS：成功 ERROR：失败',
  `updated_at` int(11) DEFAULT NULL COMMENT '支付宝财付通等异步通知时间',
  `notify_at` int(11) DEFAULT NULL COMMENT '通知客户时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

