-- ----------------------------
-- Table structure for sellers
-- ----------------------------
DROP TABLE IF EXISTS `sellers`;
CREATE TABLE `sellers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT '' COMMENT '商家名称',
  `short_name` varchar(255) DEFAULT '' COMMENT '简称',
  `balance` decimal(20,2) DEFAULT '0.00',
  `image` varchar(255) DEFAULT '' COMMENT '商家缩略图',
  `logo` varchar(255) DEFAULT '' COMMENT 'LOGO图片',
  `type` enum('MALL','CATERING','NORMAL') DEFAULT 'NORMAL' COMMENT '商家类型(商城店铺、餐馆)',
  `nature` enum('PROPRIETARY','LEAGUE') DEFAULT 'PROPRIETARY' COMMENT '性质',
  `category_id` int(11) DEFAULT NULL COMMENT '商铺系统类目',
  `circle_id` int(11) DEFAULT NULL COMMENT '商圈ID',
  `url` varchar(255) NOT NULL COMMENT '公司网址',
  `introduction` text COMMENT '简介',
  `province` int(11) DEFAULT NULL COMMENT '省',
  `city` int(11) DEFAULT NULL COMMENT '市',
  `county` int(11) DEFAULT NULL COMMENT '县',
  `email` varchar(255) DEFAULT '' COMMENT '邮件地址',
  `address` varchar(255) DEFAULT '' COMMENT '商家地址',
  `tel` varchar(255) DEFAULT '' COMMENT '商家电话',
  `phone` varchar(255) DEFAULT '' COMMENT '商家手机',
  `x` decimal(20,14) DEFAULT NULL COMMENT 'X坐标',
  `y` decimal(20,14) DEFAULT NULL COMMENT 'Y坐标',
  `star` int(11) DEFAULT '0' COMMENT '星级',
  `service_radius` int(11) DEFAULT '0' COMMENT '服务半径',
  `alert` varchar(255) DEFAULT '' COMMENT '提醒方式',
  `feature` varchar(255) DEFAULT '' COMMENT '特色',
  `seller_status` enum('NONE','OPEN','CLOSED','STOP','FROZEN') DEFAULT NULL COMMENT '状态',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  `is_delete` bit(1) DEFAULT b'0' COMMENT '删除标志',
  `created_at` int(11) DEFAULT '0' COMMENT '创建时间',
  `updated_at` int(11) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of sellers
