  `city` int(11) DEFAULT NULL COMMENT '开户行所在城市',
  `county` int(11) DEFAULT NULL COMMENT '开户行所在区县',
  `is_default` bit(1) DEFAULT b'0' COMMENT '是否默认',
  `is_delete` bit(1) DEFAULT b'0' COMMENT '是否删除',
