  `auth_token` varchar(500) DEFAULT '' COMMENT 'Auth2.0授权token',
  `username` varchar(255) DEFAULT '' COMMENT '微信公众平台帐号',
  `password` varchar(255) DEFAULT '' COMMENT '微信公众平台密码',
  `nickname` varchar(255) DEFAULT '' COMMENT '微信公众平台昵称',
  `email` varchar(255) DEFAULT '' COMMENT '微信公众帐号邮箱',
  `qrcode` varchar(255) DEFAULT '' COMMENT '二维码图片地址',
  `province` varchar(255) DEFAULT '' COMMENT '所在省份',
  `city` varchar(255) DEFAULT '' COMMENT '所在城市',
  `fans` int(11) DEFAULT '0' COMMENT '粉丝数量',
  `summary` text,
  `type` enum('NONE','service','subscribe','company') DEFAULT 'subscribe' COMMENT '公众号类型:service服务号，subscribe订阅号,company企业号',
  `auth_status` enum('NONE','AUTH') DEFAULT 'NONE' COMMENT '认证状态: NONE未认证 AUTH已认证',
  `category_id` int(11) DEFAULT '0' COMMENT '公众帐号行业类目',
  `seller_id` int(11) DEFAULT '0' COMMENT '所属用户',
  `temp_token_valid` int(11) DEFAULT '0' COMMENT 'temp_token有效期',
  `app_id` varchar(255) DEFAULT '',
  `app_secret` varchar(255) DEFAULT '',
  `menu` text,
  `created_at` int(11) DEFAULT '0' COMMENT '创建时间',
  `status` enum('NONE','ACTIVED','FREEZE','DELETED','AUTH') DEFAULT 'NONE',
  PRIMARY KEY (`id`),
  UNIQUE KEY `wx_account_unique` (`open_id`) USING HASH
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

